//se importan los componentes
import Home from "./pages/Home/Home";
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {

  return (
    <div className="App">


      <BrowserRouter>
        <Routes>
            <Route path='/Home' element={<Home />}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
